import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

const ProductItem = () => {
    return (
        <View style={styles.container}>
            <View>
                <Text>Ashutosh</Text>
            </View>
            <Text>this is product item area</Text>
        </View>
    )
}

export default ProductItem

const styles = StyleSheet.create({
    container : {
        flex : 1,
        flexDirection : "row",
        alignItems : "center"
    }
})
